$(document).ready(function(){$("#btnSearch").button({icons:{primary:"ui-icon-search"}}).on("click",function(b){var a=$(this).closest("form");$.ajax({url:a.attr("action"),data:a.serializeArray(),type:"GET",cache:false,statusCode:{200:function(c,e,d){window.location.href=c;return true},203:function(c,e,d){$("#layoutError").text(c).show()}}}).fail(function(d,e,c){alert(d.responseText)});return false})});